{
  "files": [
    {
      "path": "README.md",
      "content": "# Task Manager CLI

## Usage

- `add <title> --data <path>`: Add a new task.
- `list --data <path>`: List all tasks.
- `done <id> --data <path>`: Mark a task as done.
- `remove <id> --data <path>`: Remove a task."
    },
    {
      "path": "package.json",
      "content": "{
  "name": "task-manager",
  "version": "1.0.0",
  "main": "dist/cli.js",
  "scripts": {
    "build": "tsc -p tsconfig.json"
  }
}"
    },
    {
      "path": "tsconfig.json",
      "content": "{
  "compilerOptions": {
    "target": "ES6",
    "module": "commonjs",
    "outDir": "dist",
    "strict": true,
    "esModuleInterop": true
  },
  "include": [
    "src/**/*"
  ]
}"
    }
  ],
  "notes": "Added README.md, package.json, and tsconfig.json to complete the project structure."
}
